    false,nt"url": null,nt"notes": "This narrative report for Malheur National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1946.
    The report begins by summarizing the water conditions and wildfires during this
    period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, raptors, fish, and disease- is also covered. The
    Refuge development and maintenance section discusses physical developments. Resource
    management is outlined; topics include grazing and haying. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and violations. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
